import timerContext from "../../store/timer-context"

import "./TimerHeader.scss";

export const TimerHeader = (props) => {

  const ctx = useContext(timerContext)
  return (
    <header className="timer-header">
      <Wrapper className="header-wrapper">
        {" "}
        <CurrentTime /> 
        <Link to="/">
